import "./AuthBlock.scss";

const AuthBlock = () => {
    return (
        <div className="root">
            <img src="" alt="" className="logo" />
            <div>
                <input type="text" />
                <input type="text" />
            </div>
        </div>
    );
};

export default AuthBlock;
